!function(){var i={settings:{"border-radius":{type:"slider",initial:{animate:!0,min:0,max:50,range:"min",value:0}},"border-size":{type:"slider",initial:{animate:!0,min:0,max:15,range:"min",value:0}}},initialize:function(){this.setUpListeners(),this.setUpOptoinsUI(),this.setValue()},setUpOptoinsUI:function(){$.each(this.settings,function(i,e){switch(e.type){case"slider":$("#"+i).slider(e.initial)}})},setUpListeners:function(){$("#border-radius, #border-size").bind("create slide change",this.changeValue)},changeValue:function(i,e){console.log(e.value)}};i.initialize()}();